    /// Convert all ranges to CIDR notation strings for sing-box rule_set.
    static func allCidrs() -> [String] {
        var result: [String] = []
        result.reserveCapacity(starts.count * 2)
        for i in 0..<starts.count {
            rangeToCidrs(start: UInt64(starts[i]), end: UInt64(ends[i]), result: &result)
        }
        return result
    }

    /// Check if an IP string belongs to China IP ranges (binary search).
    static func isChinaIp(_ ipString: String) -> Bool {
        let parts = ipString.split(separator: ".")
        guard parts.count == 4,
              let a = UInt32(parts[0]), let b = UInt32(parts[1]),
              let c = UInt32(parts[2]), let d = UInt32(parts[3]) else { return false }
        let ip = (a << 24) | (b << 16) | (c << 8) | d

        var lo = 0, hi = starts.count - 1
        while lo <= hi {
            let mid = (lo + hi) / 2
            if ip < starts[mid] {
                hi = mid - 1
            } else if ip > ends[mid] {
                lo = mid + 1
            } else {
                return true
            }
        }
        return false
    }

    private static func rangeToCidrs(start: UInt64, end: UInt64, result: inout [String]) {
        var current = start
        while current <= end {
            let trailingZeros = min(current == 0 ? 32 : current.trailingZeroBitCount, 32)
            var bits = trailingZeros
            while bits > 0 {
                let blockEnd = current + (1 << bits) - 1
                if blockEnd <= end { break }
                bits -= 1
            }
            let prefix = 32 - bits
            let a = (current >> 24) & 0xFF
            let b = (current >> 16) & 0xFF
            let c = (current >> 8) & 0xFF
            let d = current & 0xFF
            result.append("\(a).\(b).\(c).\(d)/\(prefix)")
            current += (1 << bits)
        }
    }
